&lt;p&gt;&lt;b&gt;Descripci&oacute;n&lt;/b&gt;&lt;strong&gt;:&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;McAfee Total Protection 1 A&ntilde;o para 10 dispositivos en ambiente Windows, Mac, y/o Androide. Antivirus, administraci&oacute;n de la identidad y protecci&oacute;n de la privacidad de confianza para todos sus dispositivos.&lt;/p&gt;
&lt;p&gt;&lt;b&gt;Caracter&iacute;sticas&lt;/b&gt;&lt;strong&gt;:&lt;/strong&gt;&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;Prot&eacute;jase contra virus y otras amenazas online.&lt;/li&gt;
