&lt;li&gt;No tendr&aacute; que administrar nombres de usuario y contrase&ntilde;as.&lt;/li&gt;
&lt;li&gt;&lt;strong&gt;Obsequio:&nbsp;Microsoft Security Essentials&lt;/strong&gt;&lt;/li&gt;
&lt;/ul&gt;
